                valueArray      = listenFor.toString().split('|'),
                checkedValue    = $(listenTo + ":checked").val(),
                checkedEmpty    = checkedValue === undefined && (_.contains(valueArray, '0') || _.contains(valueArray, '0') || _.contains(valueArray, 'undefined'));

