/**
 * Incremental Timeout
 *
 * Used to incrementally push back a single timeout when setTimeout is called too quickly
 *
 * @param callback
 * @param time
 * @constructor
 */
function IncrementalTimeout(callback, time)
{
    this.timeout  = null;
    this.callback = callback;
    this.time     = time;
}

IncrementalTimeout.prototype.setTimeout = function(callback, time)
{
    if(is_function(callback))
    {
        this.callback = callback;
        this.time     = time;
    }

    if(is_function(this.callback))
    {
        if(isset(this.timeout))
        {
            clearInterval(this.timeout);
        }

        this.timeout = setTimeout(this.callback, this.time);
    }
};

