    /**
     * Setup Animation Players
     *
     * @param promotions
     */
    setupPlayers: function(promotions)
    {
        var promo,
            layers,
            uniqueId,
            animations,
            element;

        for(var k = 0; k < promotions.length; k++)
        {
            promo = promotions[k];

            if(promo.type == 'animation')
            {
                layers          = promo['animationData'].layers;
                uniqueId        = promo['animationData']['uniqueAnimationId'];
                animations      = promo['animationData'].animations;
                element         = document.querySelector('[unique-animation-id="' + uniqueId +'"]');
                this.players[uniqueId] = new AnimationPlayer(element, layers, animations);
            }
        }
    },

    /**
     * Play Slide Animations
     *
     * @param index
     */
    playSlideAnimations: function(index)
    {
        var element = this.selectors.slider.children[index],
            uniqueId;

        if(element)
        {
            var animWrapperChild = element.querySelector('.divLayers');

            if(animWrapperChild && animWrapperChild.getAttribute('unique-animation-id'))
            {
                uniqueId = animWrapperChild.getAttribute('unique-animation-id');

                if(uniqueId)
                {
                    this.players[uniqueId].playAnimation();
                }
            }
        }
    }
